import React from 'react';
import Grid from "@material-ui/core/Grid";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import ButtonBase from "@material-ui/core/ButtonBase";
import Logo from './images/myhome.svg'
import Chip from '@material-ui/core/Chip';
import './Dev.css'
function Dev(props) {
    return(
        <div>
            <Paper className="paper" spacing={2}>
                <Grid className='grid1' container spacing={2}>
                    <Grid item>
                        <ButtonBase>
                            <img alt={props.id} src={Logo} />
                        </ButtonBase>
                    </Grid>
                    <Grid item xs={12} sm container>
                        <Grid item xs container direction="column" spacing={2}>
                            <Grid item xs>
                                <Typography gutterBottom variant="body2">
                                    {props.company}
                                </Typography>
                                <Typography variant="subtitle1" gutterBottom>
                                    {props.position}
                                </Typography>
                                <Typography variant="body2" color="textSecondary">
                                    {props.contract}, {props.location}
                                </Typography>
                                <Typography variant="body2">
                                    {props.postedAt}
                                </Typography>
                            </Grid>
                        </Grid>
                    </Grid>
                    <Grid item xs container direction="row">
                        {props.languages.map((PostLanguages) => {
                            return <Chip className="chip" label={PostLanguages} variant="outlined" key={PostLanguages.uid} />
                        })}
                    </Grid>
                </Grid>
            </Paper>
        </div>
    )
}

export default Dev;
